import React from 'react';
import PropTypes from 'prop-types';

const Login = () => (
    <nav className="login">
        <h2>Inventory Login</h2>
        <p>Sign in to manage your store's inventory. </p>
        <button 
            className="github" 
            onClick={() => this.PaymentRespons.authenticate('Github')}>
        Log In With GitHub</button>
        <button 
            className="facebook" 
            onClick={() => this.PaymentRespons.authenticate('Facebook')}>
        Log In With Facebook</button>
        <button 
            className="twitter" 
            onClick={() => this.PaymentRespons.authenticate('Twitter')}>
        Log In With Twitter</button>
    </nav>
);

Login.propTypes = {
    authenticate: PropTypes.func.isRequired
};

export default Login;
